#define MODE_GAME_LOADER  0
#define MODE_CMDIF        1

#define MODE_BUTTON       _DEF_BUTTON1


const volatile __attribute__((section(".version_str"))) uint8_t fw_version_str[256] = _DEF_APP_VER_STR;
const volatile __attribute__((section(".version_num"))) uint8_t fw_version_num[256] = _DEF_APP_VER_NUM;


//-- External Variables
//
uint8_t ap_flag_game_loader = 0;

//-- Internal Functions
void drawLogo(uint8_t mode);
void gameTest(void);



//-- External Functions
extern void swtimerISR(void);

static uint8_t app_mode = MODE_GAME_LOADER;


void apInit(void)
{
  timerSetPeriod(_DEF_TIMER2, 1000);
  timerAttachInterrupt(_DEF_TIMER2, swtimerISR);
  timerStart(_DEF_TIMER2);

  gameloaderInit();
  drawLogo(0);
}



void apMain(void)
{
  uint32_t pre_time;
  uint32_t excuteGame, game_addr;
  game_tag_type_a_t *p_tag;
  err_code_t err;

  pre_time = millis();
  while(1)
  {
    switch(app_mode)
    {
      case MODE_GAME_LOADER :
        gameloaderProcess();
        break;

      case MODE_CMDIF :
        cmdifMain();
        break;
    }

    if (buttonGetReleasedEvent(MODE_BUTTON) == true)
    {
      if (buttonGetPressedTime(MODE_BUTTON) > 100 && buttonGetPressedTime(MODE_BUTTON) < 1000)
      {
        err = checkGame(GAME_TAG_TYPE_A, _HW_DEF_FLASH_ADDR_GAME_START);

        if(err == OK)
        {
          p_tag = (game_tag_type_a_t*) (_HW_DEF_FLASH_ADDR_GAME_START);

          game_addr = *(uint32_t*)(p_tag->address);
          voidFuncPtr excuteGame = (voidFuncPtr)game_addr;

          drawLogo(2);
          excuteGame();
          drawLogo(1);
        }
      }

      if (buttonGetPressedTime(MODE_BUTTON) > 2000)
      {
        if(app_mode == MODE_GAME_LOADER)
        {
          app_mode = MODE_CMDIF;
        }
        else if(app_mode == MODE_CMDIF)
        {
          app_mode = MODE_GAME_LOADER;
        }
      }
    }

    if (tsIsDetected() == 2)
    {
      gameTest();
    }

    if (millis()-pre_time >= 500)
    {
      pre_time = millis();
      ledToggle(_DEF_LED1);
    }
  }
}





void drawLogo(uint8_t mode)
{
  uint32_t x_offset;
  uint32_t y_offset;
  uint32_t step;



  x_offset = (800 - LOGO_WIDTH ) / 2;
  y_offset = (480 - LOGO_HEIGHT) / 2;


  for (step = 0; step <= 200; step += 8)
  {
    while(lcdDrawAvailable() == false);

    lcdClear(0x0000);
    for(uint16_t x = 0; x < LOGO_WIDTH; x++)
    {
      for(uint16_t y = 0; y < LOGO_HEIGHT; y++)
      {
        if (mode == 0)
        {
          lcdDrawPixel(x + x_offset, y + y_offset + 199-step, (uint32_t)oroca_img[y*LOGO_WIDTH + x]);
        }
        else if (mode == 1)
        {
          lcdDrawPixel(x + x_offset, y + y_offset + step - 200, (uint32_t)oroca_img[y*LOGO_WIDTH + x]);
        }
        else
        {
          lcdDrawPixel(x + x_offset, y + y_offset - step, (uint32_t)oroca_img[y*LOGO_WIDTH + x]);
        }
      }
    }
    lcdRequestDraw();
  }
  //delay(1000);
  //lcdClear(0x0000);
  //lcdCopyLayer(_DEF_LCD_LAYER2, _DEF_LCD_LAYER1);

  if (mode == 2)
  {
    while(lcdDrawAvailable() == false);
    lcdClear(0x0000);
    lcdRequestDraw();
  }
}


