extern uint32_t draw_time;;



void gameTest(void)
{
  uint32_t pre_time;
  uint8_t *p_buf;

  gb.begin();
  gb.display.clear();



  int cnt = 0;
  unsigned long timeBenchmark = 20;
  uint16_t startTime = millis();

  animation.setTransparentColor(ColorIndex::blue);
  animation.setFrame(0);

  uint16_t ball_x = 0;
  uint16_t ball_y = 0;
  while(1)
  {
    if (gb.update())
    {
      pre_time = millis();

      // clear the previous screen
      gb.display.clear();

      gb.display.drawImage(gb.display.width()-imageTab[0]*2 ,0,myImage, imageTab[0]*2, imageTab[1]*2);


      gb.display.setColor(Color::gray);
      gb.display.fillRect(0, 130, gb.display.width(), 50);


      gb.display.setColor(BLUE);
      //gb.display.fillRect(ball_x, ball_y, 50, 50);

      if (tsIsDetected() > 0)
      {
        gb.display.fillRect(tsGetXAxis(0)/2-50, tsGetYAxis(0)/2-50, 50, 50);
      }

      gb.display.drawImage(ball_x, 130,animation, 50, 50);
      animation.setFrame(0+ball_x%2);

      ball_x = (ball_x + 1) % gb.display.width();
      ball_y = (ball_y + 1) % 240;


      gb.display.setCursor(0, 0);
      gb.display.setColor(WHITE);
      gb.display.print(1000 / (draw_time/1000));
      gb.display.print(" FPS");
      gb.display.setColor(BROWN);
      gb.display.print(" (");
      gb.display.print(draw_time/1000);
      gb.display.println("ms)");

      gb.display.print(1000 / (timeBenchmark));
      gb.display.print(" FPS");
      gb.display.setColor(BROWN);
      gb.display.print(" (");
      gb.display.print(timeBenchmark);
      gb.display.println("ms)");

      gb.display.print(cnt);
      gb.display.println(" ms");

      gb.display.setColor(WHITE);
      gb.display.print(gb.display.getBufferSize() / 1024);
      gb.display.print(" KB");
      gb.display.setColor(BROWN);
      gb.display.println(" BUFFER");

      cnt = millis()-pre_time;


      uint16_t endTime = millis();
      timeBenchmark = endTime - startTime;
      startTime = millis();
    }
  }
}





